create table Users (
	UserID VARCHAR(50),
	Username VARCHAR(50),
	FirstName VARCHAR(50),
	LastName VARCHAR(50),
	DateOfBirth DATE,
	Password VARCHAR(50),
	DateAdded DATE
);


create table Groups (
	GroupID VARCHAR(50),
	GroupName VARCHAR(10),
	CreatedBy INT,
	DateAdded DATE
);


create table GroupMembershipRequests (
	GroupMemberShipRequestsID VARCHAR(50),
	GroupID INT,
	GroupMemberUserID INT,
	IsGroupMemberShipAccepted VARCHAR(50),
	DateAccepted DATE
);
